INSERT INTO `tblposts` (`id`, `PostTitle`, `CategoryId`, `SubCategoryId`, `PostDetails`, `PostingDate`, `UpdationDate`, `Is_Active`, `PostUrl`, `PostImage`) VALUES
(19, 'ভারতিয় মুদ্রার ইতিহাস', 8, 10, '<p style=\"text-align: justify; margin-top: 0.5em; margin-bottom: 0.5em;\"><font color=\"#202122\" face=\"sans-serif\">খ্রীষ্টপূর্ব ষষ্ঠ শতক থেকেই ভারতীয় মুদ্রার ইতিহাস আরম্ভ হয়। চীনা ইয়েন এবং লিডিয়ান ষ্টেটারের সাথে প্রাচীন ভারত মুদ্রার প্রারম্ভিক প্রচলনকারী দেশসমূহের অন্যতম।</font></p><p style=\"text-align: justify; margin-top: 0.5em; margin-bottom: 0.5em;\"><font color=\"#202122\" face=\"sans-serif\">হিন্দী রুপিয়া শব্দটি পিটিয়ে চ্যাপ্টা করা রুপো (ধাতু) অর্থাৎ রুপোর মুদ্রা বা মোহর মেরে চিহ্নিত করা কাজকে বোঝানো সংস্কৃত শব্দ রূপার থেকে উদ্ভূত হয়েছে। [৩] এই রুপো শব্দটি আকার বা আকৃতি বোঝানো সর্বনাম পদ রূপএর থেকে এসেছে এবং এটি মূলতঃ দ্রাবিড় ভাষার শব্দ।[৪]</font></p><p style=\"text-align: justify; margin-top: 0.5em; margin-bottom: 0.5em;\"><span style=\"color: rgb(32, 33, 34); font-family: sans-serif;\">কৌটিল্যের অর্থশাস্ত্র-এ রুপোর মোহর রূপ্যরূপ, সোনার মোহর সুবর্ণরূপ এবং সীসার মোহর সীসারূপ এর কথা উল্লেখ আছে।[১]</span></p><p style=\"text-align: justify; margin-top: 0.5em; margin-bottom: 0.5em;\"><font color=\"#202122\" face=\"sans-serif\">শের শাহ শূরী তার পাঁচ বছরের শাসনকালে (১৫৪০-১৫৪৫) ১৭৮ রতি ওজনের রুপোর মুদ্রা রুপিয়া নামে প্রচলন করেছিলেন।[৩][৫] মোগল তথা মারাঠাদের রাজত্বকালের সঙ্গে ইংরেজশাসিত ভারতে রুপোর মুদ্রা প্রচলিত ছিল।[৬] কাগজের ব্যাঙ্কনোটের সর্বপ্রথম প্রচলনকারীর মধ্যে ছিল ব্যাঙ্ক অফ হিন্দুস্তান (১৭৭০-১৮৩২), ওয়ারেন হেষ্টিংসের প্রতিষ্ঠা করা সেন্ট্রাল ব্যাঙ্ক অব বেঙ্গল অ্যান্ড বিহার (১৭৭৩-৭৫) এবং বেঙ্গল ব্যাঙ্ক (১৭৮৪-৯১)।</font></p><p style=\"text-align: justify; margin-top: 0.5em; margin-bottom: 0.5em;\"><font color=\"#202122\" face=\"sans-serif\">১৯ শতকের সময়ে অন্যান্য সবল অর্থব্যবস্থাসমূহে সোনার ভিত্তিতে দেশীয় মুদ্রার মূল্য নির্ধারিত হওয়ার বিপরীতে ভারতীয় টাকা রুপোর (ধাতু) ওপর নির্ধারণ করা হয়েছিল। ইংরেজ শাসনকাল এবং স্বাধীনোত্তর কালের প্রথমভাগে ভারতীয় এক টাকাকে আনা হিসাবে ১৬ আনায় ভাগ করা হয়েছিল। প্রতিটি আনা ৪ পয়সা বা বারো পাইতে পুনরায় বিভাজিত করার ব্যবস্থা ছিল। প্রতিটি এক টাকা ১৬ আনা বা ৬৪ পয়সা বা ১৯২ পাইয়ের সমান ছিল। ১৯৫৭ সালে এক টাকাকে নতুন করে ১০০ নয়া পয়সাতে ভাগ করা হয় এবং কিছু বছর পরেই আগের নয়া শব্দটি উঠিয়ে দেওয়া হয়।</font></p><p style=\"text-align: justify; margin-top: 0.5em; margin-bottom: 0.5em;\"><font color=\"#202122\" face=\"sans-serif\"><br></font></p><p style=\"text-align: justify; margin-top: 0.5em; margin-bottom: 0.5em;\"><font color=\"#202122\" face=\"sans-serif\">কিছু বছর পর্যন্ত ইংরেজশাসিত এবং ভারত থেকে নিয়ন্ত্রিত বেশ কয়েকটি স্থান যেমন পূর্ব এশিয়া, দক্ষিণ আরব এবং পার্সিয়ান উপকূল ইত্যাদিতে ভারতীয় টাকা সরকারী মুদ্রা হিসাবে প্রচলিত হয়েছিল।</font></p><p style=\"text-align: justify; margin-top: 0.5em; margin-bottom: 0.5em;\"><a href=\"https://gist.github.com/towfiq39/98834c35e5eabf19c58cc18455c7e853\">go to see code&nbsp;</a></p><p style=\"text-align: justify; margin-top: 0.5em; margin-bottom: 0.5em;\"><font color=\"#202122\" face=\"sans-serif\"><br></font></p>', '2021-07-10 03:21:31', '2021-07-15 04:52:08', 1, 'ভারতিয়-মুদ্রার-ইতিহাস', '8c458e3489329de9532ce70409eeef1e.jpg'),
